function set_require_statu(e){$("#workStatu").text(e.state)}function set_require_disk(e){$("#diskUsage").text(e.used.toFixed(0)+"GB / "+e.total.toFixed(0)+"GB")}function set_require_memory(e){$("#memoryUsage").text(e.used.toFixed(1)+"GB / "+e.total.toFixed(1)+"GB")}function set_require_cpu(e){$("#cpuUsage").text(e.percent.toFixed(1)+"%")}function set_require_version(e){$("#softVer").text("1.13.0")}$((function(){setInterval((function(){$.ajax(urlGetSysInfo).done((function(e){for(var t=0;t<e.length;t++)switch(e[t].name){case"workStatu":set_require_statu(e[t].data);break;case"hardDisk":set_require_disk(e[t].data);break;case"memory":set_require_memory(e[t].data);break;case"cpu":set_require_cpu(e[t].data);break;case"softVersion":set_require_version(e[t].data)}}))}),3e3)}));
